import React from "react";
import Fab from '@mui/material/Fab';
import InfoIcon from '@mui/icons-material/Info';
import Divider from '@mui/material/Divider';
import toolTip from "./ToolTip";

function SelectField(props){
    const [option, setOption] = React.useState("");
    const handleChange = (event) => {
        setOption(event.target.value);
    };
    const {required, options, defaultValue, immutable} = props.validate;
    const describe = (!props.description) ? false : true;
    const Tooltip = toolTip();

    function placeholderOption(placeholder){
        const exists = (!props.placeholder) ? false : true;
        if(exists){
            return <option value="placeholder">{placeholder}</option>;
        }
        return null;
    }

    return ( 
        <div className="formField">
            <span className="label">{props.label}
                <span className="required">{(props.required?"*    ":"     ")}</span>
            </span>
            {(describe) ?
                <Tooltip
                title={
                <React.Fragment>
                <div className="infoHeading">{props.label}</div>
                <Divider />
                <div className="info">{props.description}</div>
                </React.Fragment>
                }
                >   
                <Fab style={{height:"20px", width:"20px", minHeight:"20px", backgroundColor:"#fbfdff"}} color="primary" aria-label="add">
                <InfoIcon color="primary" style={{height:"20px", width:"20px"}}/>
                </Fab>
                </Tooltip> : null
            }
            <select className="inputField" disabled={immutable} name={props.label} required={required}>
                {placeholderOption(props.placeholder)}
                {options.map(item => {
                    const optionDescribe = (!item.description) ? false : true;
                    if(defaultValue===item.label){
                        return (<option value={item.label} selected>{item.value}{(optionDescribe) ?
                <Tooltip
                title={
                <React.Fragment>
                <div className="optionInfoHeading">{item.label}</div>
                <Divider />
                <div className="optionInfo">{item.description}</div>
                </React.Fragment>
                }
                >   
                <Fab style={{height:"15px", width:"15px", minHeight:"15px", backgroundColor:"#fbfdff"}} color="primary" aria-label="add">
                <InfoIcon color="primary" style={{height:"15px", width:"15px"}}/>
                </Fab>
                </Tooltip> : null
            }</option>);
                    }
                    else{
                        return (<option value={item.label}>{item.value}{(optionDescribe) ?
                <Tooltip
                title={
                <React.Fragment>
                <div className="optionInfoHeading">{item.label}</div>
                <Divider />
                <div className="optionInfo">{item.description}</div>
                </React.Fragment>
                }
                >   
                <Fab style={{height:"15px", width:"15px", minHeight:"15px", backgroundColor:"#fbfdff"}} color="primary" aria-label="add">
                <InfoIcon color="primary" style={{height:"15px", width:"15px"}}/>
                </Fab>
                </Tooltip> : null
            }</option>);
                    }
                })}
            </select>
        </div>
    );
}
export default SelectField;
